import React from 'react';
import Buscar from "../ui/Buscar";

const Header = () => {
    return ( 
        <header>
            <div>
                <div>
                    <p>P</p>
                    {/* Buscador aqui */}
                    <Buscar></Buscar>
                    {/* Nav Aqui */}

                </div>
                <div>
                    {/** Menu de administracion */}
                </div>
            </div>
        </header>
     );
}
 
export default Header;
